    data: |
      SELECT DISTINCT + col2 / col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * cor0.col2 IN ( - col0 + col0 + col1 );
  - name: tab1

outputs:
  - name: q9298.out
    data: |
      0
      1
      18
